function show_rule(rule_id, field_name) {

    var id = field_name + rule_id;
    if ($('#rule_' + id).length > 0) {
        return;
    }

//$param = "$table_name.$field_name, $primaryKey, {\$_POST['$primaryKey']}";


    var $x = `<div class="input-group input-group-sm mb-1" title="` + $validationRules[rule_id].desc + `" id="rule_` + id + `" style="">
                    <div class="input-group-prepend">
                        <span class="input-group-text" style="padding: 0.1rem 0.2rem;">
                            <label class="">
                                <input type="checkbox" class="rule_class hide_rule"  data-id="` + id + `" name="field[` + field_name + `][rule][` + rule_id + `][check]" value="1" checked="">
                                <span></span>
                            </label>
                        </span>
                        <span class="input-group-text" style="padding: 0.1rem 0.2rem;">` + rule_id + `</span>
                    </div>`;
    if ($validationRules[rule_id].parametre) {

        var $paramValue = '';
        if (rule_id === 'is_unique') {
            $paramValue = $table_name + '.' + field_name + ',' + $primaryKey + ',' + '{$_POST[\'' + $primaryKey + '\']}';
        } else if (rule_id === 'valid_ip') {
            $paramValue = 'ipv4';
        }

        $x += '\n' + `     <input type="text" data-value="` + id + `" name="field[` + field_name + `][rule][` + rule_id + `][param]" class="form-control" placeholder="" value="` + $paramValue + `">`;
    }

    $x += '\n' + `</div>`;
    $('.rule_area_' + field_name).append($x);
//            $('#rule_' + id).show();
    $('[data-id="' + id + '"]').attr('checked', true);
}
