function subtable(crud_id, targetID, targetID2, selected) {

    $.post(crud4coreUrl("crud/getPageList/" + crud_id), {crud_id: crud_id}, function (data)
    {
        var $html = '';
        if (isEmpty(data)) {
            $html += `<option value="">There Is NO Pages</option>`;
        } else {

            for (key in data) {
                var pageName = data[key]['page_slug'];
                $html += `<option value="` + pageName + `">` + pageName + `</option>`;
            }

        }


        $html += '';
        $('#' + targetID).html($html);
    }, 'json');
    $.post(crud4coreUrl("crud/getSubtableField/" + crud_id), {crud_id: crud_id}, function (data)
    {

        console.log(data);
        var $html = '';
        if (isEmpty(data)) {
            $html += `<option value="">There Is NO Pages</option>`;
        } else {
            for (key in data) {

                $selected = (key == $primaryKey) ? ' selected' : '';
                $html += `<option value="` + key + `"  ` + $selected + `>` + key + `</option>`;
            }
        }

        $html += '';
        console.log($html);
        $('#' + targetID2).html($html);
    }, 'json');
}
