function relatiobTableChanged(table_name, field_name, widgetName, appName) {

    console.log(appName, 'appName');
    //
    var $relationKEYdropdown = $('.relationKEYdropdown.' + appName + '[data-name="' + field_name + '"]');
    var $relationValuedropdownn = $('.relationValuedropdown.' + appName + '[data-name="' + field_name + '"]');
    var $relationValuedropdownn2 = $('.relationValuedropdown.' + appName + '[data-name2="' + field_name + '"]');
    
    
    $.post(crud4coreUrl('getTableFields/' + table_name + '?project_id=' + project_id), {table_name: table_name, project_id: project_id}, function (data)
    {
        var $select_option = '<option value="">SELECT</option>';
        for (key in data) {
            $select_option += '<option value="' + data[key] + '">' + data[key] + '</option>';
        }

        var $html_key = '<select name="field[' + field_name + '][table][' + appName + '][relationTableKeyField]" class="form-control form-control-sm">' + $select_option + '</select>';
        
        var $html_value = '<select name="field[' + field_name + '][table][' + appName + '][relationTableValueField]" class="form-control form-control-sm">' + $select_option + '</select>';
        var $html_value2 = '<select name="field[' + field_name + '][table][' + appName + '][relationTableValueField2]" class="form-control form-control-sm">' + $select_option + '</select>';
        
        $relationKEYdropdown.html($html_key);
        
        $relationValuedropdownn.html($html_value);
        $relationValuedropdownn2.html($html_value2);
        
    }, 'json');
    
    
    if (widgetName === 'SELECT2_JS_NEW'){

        console.log('SELECT2_JS_NEW', 'SELECT2_JS_NEWSELECT2_JS_NEW');
        
        var $relationFormdropdown = $('.widgetRelationViewFormSlug.' + appName + '[data-name="' + field_name + '"]');
                            
        $.post(crud4coreUrl('getFormList/' + table_name + '?project_id=' + project_id), 
                {table_name: table_name, project_id: project_id, codemodule_id : $codemodule_id, crud_id:$crud_id},'json')  
        .done(function (data, textStatus, errorThrown) {
            
            var $select_option = '';

            for (key in data) {
                
                var fID = data[key]['form_id'];
                var form_slug = data[key]['form_slug'];
                
                $select_option += '<option value="' + form_slug + '" title=" Form ID: ' + fID + '">' + data[key]['form_title']+ '</option>';
            }

            var $html_key = '<select name="field[' + field_name + '][widgetRelationViewFormSlug]" class="form-control form-control-sm">' + $select_option + '</select>';

           
            $relationFormdropdown.html($html_key);
            
        }).fail(function (jqXHR, textStatus, errorThrown) {
            
            var error = _getApiErrorString(jqXHR);
            $relationFormdropdown.html(error);
                        
        });
        
    }
    
}
