function show_option(widgetName, fieldName) {

    $('.widgetOptions[data-name="' + fieldName + '"]').html('Loading...');
    var $sendData = {
        fieldData: {
            fieldName: fieldName,
            widgetName: widgetName,
            tableName: $table_name,
            primaryKey: $primaryKey,
            namespace: $namespace,
            namespacePath: $namespacePath,
        },
        project_id:project_id,
        codemodule_id:$codemodule_id,
        crud_id:$crud_id,
        listTables: $listTables,
//        dbFields: $dbFields,
        oldData: $oldData != null && !isEmpty($oldData[fieldName]) ? $oldData[fieldName] : null,
    };
        
    $.ajax({
        method: "POST",
        url: crud4coreUrl('loadWidget?project_id=' + project_id), //SITE_URL + 'builder/' + LANG_crud4_page['panel_language'] + '/crud/loadWidget',
        data: $sendData,
        async: true
    }).done(function (data) {

        $('.widgetOptions[data-name="' + fieldName + '"]').html(data);
        initSelectpicker();
        init_selecIcons();
        
        general.initPackage('checkAndShow');
        
    });
}
